import React from 'react'
import { useSelector } from 'react-redux/es/hooks/useSelector'

function card() {
  const {movie,loading}=useSelector((state)=>state.MovieData);
  return (
    <div>
      {
        movie.map((ele)=>{
          {ele.title}
        })
      }
    </div>
  )
}

export default card
